  `cycle_type` enum('daily','weekly','monthly','yearly') COLLATE utf8mb4_unicode_ci NOT NULL DEFAULT 'monthly' COMMENT 'cycle type',
  `daily_enabled` tinyint(1) DEFAULT '1' COMMENT '是否启用日保养',
