  `monthly_day` int DEFAULT NULL COMMENT '月保养在每月几号完成(1-31)',
  `yearly_month` int DEFAULT NULL COMMENT '年保养在每年几月完成(1-12)',
  `yearly_day` int DEFAULT NULL COMMENT '年保养在每年几号完成(1-31)',
