INSERT INTO `temporary_task_library` VALUES (7,'平台制作与电箱安装','滚筒筛制作检修平台，走线槽，安装电箱。',1.00,10,NULL,35,'艾成礼','2026-01-22 15:27:46','2026-01-22 15:27:46'),(8,'螺旋减速机更换','更换1、2、3号螺旋减速机。',1.00,8,NULL,35,'艾成礼','2026-01-22 15:27:46','2026-01-22 15:27:46'),(9,'原料秤支架制作安装','制作原料秤支架焊接，安装原料称',1.00,10,NULL,35,'艾成礼','2026-01-22 15:27:46','2026-01-22 15:27:46'),(10,'减速机安装与罩子组装','C箱安装板链减速机，组装罩子焊接吊点，安装。',1.00,10,NULL,35,'艾成礼','2026-01-22 15:27:46','2026-01-22 15:27:46'),(11,'卫生清理','中关村小学怀柔分校搞卫生。',1.00,10,NULL,35,'艾成礼','2026-01-22 15:27:46','2026-01-22 15:27:46'),(12,'进料口加工安装','下料加工滚筒筛进料料口，安装。',1.00,10,NULL,35,'艾成礼','2026-01-22 15:27:46','2026-01-22 15:27:46'),(13,'防护罩安装','安装罩子。',1.00,10,NULL,35,'艾成礼','2026-01-22 15:27:46','2026-01-22 15:27:46'),(14,'结构加固与配件安装','加固焊接横梁，安装C箱皮带出料口，安装板链底板。',1.00,10,NULL,35,'艾成礼','2026-01-22 15:27:46','2026-01-22 15:27:46'),(15,'电气接线调试','接挡盒限位线，激光对射线，气缸控制线，调试。',1.00,10,NULL,35,'艾成礼','2026-01-22 15:27:46','2026-01-22 15:27:46'),(16,'库房整理与辅助工作','电机入库，C箱螺旋减速机安装键，精分减速机安装键，C箱清理卫生，配合秘岗云工作。',1.00,10,NULL,35,'艾成礼','2026-01-22 15:27:46','2026-01-22 15:27:46'),(17,'平台固定与支架切割','大虫加料平台固定，切割混料机原粉碎机支架。',1.00,10,NULL,35,'艾成礼','2026-01-22 15:27:46','2026-01-22 15:27:46'),(18,'控制箱安装与线缆敷设','1、安装C箱就地控制箱，敷设线缆。2、接A箱电机主线到端子。3、接A箱控制信号线。4、安装B1、B3上下拖链及敷设拖链线.5、敷设A箱到B3,C箱电源线，信号线。6、敷设到温控设备的线及线管。7，安装到培养室，办公室快插电源线。8、单机点动测试。',1.00,10,NULL,35,'艾成礼','2026-01-22 15:27:46','2026-01-22 15:27:46'),(19,'管路改造与保温','换热器保温，冷却器接排水管走到C箱螺旋里，螺旋安装孔打胶，改进料称挂钩，安装养殖盒。',1.00,10,NULL,35,'艾成礼','2026-01-22 15:27:46','2026-01-22 15:27:46'),(20,'调试配合与配件安装','配合调试，安装行走伺服电机减速机试机。加工流利条最外边小轮的固定皮子安装。',1.00,10,NULL,35,'艾成礼','2026-01-22 15:27:46','2026-01-22 15:27:46'),(21,'仪表安装与单机调试','1、安装C箱称重仪表，敷设C箱滚筒电机皮带电源。2、单机调试。',1.00,10,NULL,35,'艾成礼','2026-01-22 15:27:46','2026-01-22 15:27:46'),(22,'缝隙封堵与风扇更换','B箱顶部皮带封堵缝隙，更换粉碎机加料螺旋变频风扇。',1.00,10,NULL,35,'艾成礼','2026-01-22 15:27:46','2026-01-22 15:27:46'),(23,'照明安装','围挡内安装照明灯。',1.00,10,NULL,35,'艾成礼','2026-01-22 15:27:46','2026-01-22 15:27:46'),(24,'封堵与挡板制作','粉碎机进料口封堵，边板封堵打胶，制作挡板。',1.00,10,NULL,35,'艾成礼','2026-01-22 15:27:46','2026-01-22 15:27:46'),(25,'出料口焊接制作','精分制作筛上物出料料口焊接。',1.00,10,NULL,35,'艾成礼','2026-01-22 15:27:46','2026-01-22 15:27:46'),(26,'踏步制作与出料口改造','制作A箱夸螺旋踏步，改混料机出料螺旋出料口。',1.00,10,NULL,35,'艾成礼','2026-01-22 15:27:46','2026-01-22 15:27:46'),(27,'挡料板制作安装','制作翻盒挡料板安装。',1.00,10,NULL,35,'艾成礼','2026-01-22 15:27:46','2026-01-22 15:27:46'),(28,'机械零部件加工','下料加工真空箱，下智慧平台料，加工轴，铣键槽安装齿轮。',1.00,10,NULL,35,'艾成礼','2026-01-22 15:27:46','2026-01-22 15:27:46'),(29,'电气对点配合','配合4.0电气对点工作。',1.00,10,NULL,35,'艾成礼','2026-01-22 15:27:46','2026-01-22 15:27:46'),(30,'调试配合与保温施工','配合调试，现场清理，B、C箱之间风管进箱保温。',1.00,10,NULL,35,'艾成礼','2026-01-22 15:27:46','2026-01-22 15:27:46'),(31,'机械调整与联轴器更换','B3垫高流利条达到调平料盒，联轴器到货后进行智慧平台X轴移动电机联轴器更换工作（优先完成B1智慧平台）。',1.00,10,NULL,35,'艾成礼','2026-01-22 15:27:46','2026-01-22 15:27:46'),(32,'风管改造与封堵','改培养风管，封堵原风孔，封堵集装箱原进风口。',1.00,10,NULL,35,'艾成礼','2026-01-22 15:27:46','2026-01-22 15:27:46'),(33,'隔断护板制作固定','制作进培养室隔断护板固定。',1.00,10,NULL,35,'艾成礼','2026-01-22 15:27:46','2026-01-22 15:27:46'),(34,'支架焊接与气缸安装','焊接吸料装置支架，安装气缸、滑轨。',1.00,10,NULL,35,'艾成礼','2026-01-22 15:27:46','2026-01-22 15:27:46'),(35,'台阶下料焊接','下料焊接培养室进门台阶。',1.00,10,NULL,35,'艾成礼','2026-01-22 15:27:46','2026-01-22 15:27:46'),(36,'气动阀安装与配管','4、5号智慧平台安装气动阀，走气管。',1.00,10,NULL,35,'艾成礼','2026-01-22 15:27:46','2026-01-22 15:27:46'),(37,'机械故障排除与调整','调整1、2号智慧平台钩舌推板，调整B1箱流利条处理料盒滑出故障。',1.00,10,NULL,35,'艾成礼','2026-01-22 15:27:46','2026-01-22 15:27:46'),(38,'除臭塔巡检维护','2.5和供卵除臭塔巡视（每天），清理过滤网（每周两次），换水（每月1日和15日），加水（每天），清喷头（每月一次）。',1.00,10,NULL,35,'艾成礼','2026-01-22 15:27:46','2026-01-22 15:27:46'),(39,'坐标测量与点位核实','1，测坐标。2.核实输入点位和输出点位和实际对应。',1.00,10,NULL,35,'艾成礼','2026-01-22 15:27:46','2026-01-22 15:27:46'),(40,'电控箱制作与监控安装','1、制作总电控箱。2、安装摄像头。',1.00,10,NULL,35,'艾成礼','2026-01-22 15:27:46','2026-01-22 15:27:46'),(41,'隔断网更换','更换4#羽化室隔断间羽化拉链网',1.00,10,NULL,35,'艾成礼','2026-01-22 15:27:46','2026-01-22 15:27:46'),(42,'电气触点加装与校秤','1、翻桶机物料选择按钮加装常闭辅助触点并串接入另一常闭触点。2、校准加料秤。',1.00,10,NULL,35,'艾成礼','2026-01-22 15:27:46','2026-01-22 15:27:46'),(43,'数据抄表','抄表。',1.00,5,NULL,35,'艾成礼','2026-01-22 15:27:46','2026-01-22 15:27:46'),(44,'配电箱巡检','每日巡检配电箱。',1.00,10,NULL,35,'艾成礼','2026-01-22 15:27:46','2026-01-22 15:27:46'),(45,'坐标测量与点位核实','1，测坐标。2.核实输入点位和输出点位和实际对应。',1.00,10,NULL,35,'艾成礼','2026-01-22 15:27:46','2026-01-22 15:27:46'),(46,'电控箱制作与监控安装','1、制作总电控箱。2、安装摄像头。',1.00,10,NULL,35,'艾成礼','2026-01-22 15:27:46','2026-01-22 15:27:46'),(47,'电气触点加装与校秤','1、翻桶机物料选择按钮加装常闭辅助触点并串接入另一常闭触点。2、校准加料秤。',1.00,10,NULL,35,'艾成礼','2026-01-22 15:27:46','2026-01-22 15:27:46'),(48,'平台接线调试','C箱智慧平台接线，调试。',1.00,10,NULL,35,'艾成礼','2026-01-22 15:27:46','2026-01-22 15:27:46'),(49,'风管改造与封堵','改培养风管，封堵原风孔，封堵集装箱原进风口。',1.00,10,NULL,35,'艾成礼','2026-01-22 15:27:46','2026-01-22 15:27:46'),(50,'隔断护板制作固定','制作进培养室隔断护板固定。',1.00,10,NULL,35,'艾成礼','2026-01-22 15:27:46','2026-01-22 15:27:46'),(51,'机械故障排除与调整','调整1、2号智慧平台钩舌推板，调整B1箱流利条处理料盒滑出故障。',1.00,10,NULL,35,'艾成礼','2026-01-22 15:27:46','2026-01-22 15:27:46'),(52,'除臭塔巡检维护','2.5及供卵除臭塔巡视（每天），清理过滤网（每周两次），每周换水，加水（每天），清喷头（每月一次）。',1.00,10,NULL,35,'艾成礼','2026-01-22 15:27:46','2026-01-22 15:27:46'),(53,'支架焊接与气缸安装','焊接吸料装置支架，安装气缸、滑轨。',1.00,10,NULL,35,'艾成礼','2026-01-22 15:27:46','2026-01-22 15:27:46'),(54,'台阶与平台焊接','下料焊接台阶，焊接吸料平台。',1.00,10,NULL,35,'艾成礼','2026-01-22 15:27:46','2026-01-22 15:27:46'),(55,'库房管理','库房整理，出入库，整理单据。',1.00,10,NULL,35,'艾成礼','2026-01-22 15:27:46','2026-01-22 15:27:46'),(56,'物流签收','签收快递。',1.00,10,NULL,35,'艾成礼','2026-01-22 15:27:46','2026-01-22 15:27:46'),(57,'台阶下料焊接','下料焊接培养室进门台阶。',1.00,10,NULL,35,'艾成礼','2026-01-22 15:27:46','2026-01-22 15:27:46'),(58,'隔断网更换','更换4#羽化室隔断间羽化拉链网',1.00,10,NULL,35,'艾成礼','2026-01-22 15:27:46','2026-01-22 15:27:46'),(59,'料仓焊接与支架制作','焊接吸料料仓，制作吸料气缸支架，焊接支架安装轨道。',1.00,10,NULL,35,'艾成礼','2026-01-22 15:27:46','2026-01-22 15:27:46');
